import React from 'react';

import classes from './Logo.module.css';

const Logo = (props) => {

    let colorClass = [classes.Logo];

    switch (props.color) {
        case "lightBlue":
            colorClass.push(classes.lightBlue);
            break;
        case "white":
            colorClass.push(classes.white);
            break;
        default:
            colorClass.push(classes.black);
            break;    
    }

    return (
        <p className={colorClass.join(' ')}>BoockyBook</p>
    );

};

export default Logo;
